import Navbar from '../components/Navbar';



const index = (props) => (
    <div>
    <Navbar />
        <div className="about_text">
        <h1>Welcome to Bitzprice</h1>
        <p>THis is the index page</p>
 
        </div>
        
        <style jsx>{`
    .abouts{
        position:relative;
        display:inline-line;
    }
    .about_text{
        float:left;
        position:absolute;
        top:20px;
        left:130px;

    }
 

`}</style>
    </div>
);




export default index;
